import React, { Component } from "react";
import  { UserConsumer } from'./Username';

class CompoC extends Component {
  render() {
    return (
      <UserConsumer>
        {(Username) => {
          return <div>Hellow {Username}</div>
        }}
      </UserConsumer>
    );
  }
}

export default CompoC;
